import React from 'react';
import ReactDOM from 'react-dom';



const SearchPanel = () => <input placeholder='search' />;



const App = () => {
  return (
    <div>
      <AppHeader />
      <SearchPanel />
      <TodoList />
    </div>
  );
};

ReactDOM.render(<App />,
  document.getElementById('root'));
